script: |
  super -f text -I q12096.spq | sort > q12096.out

inputs:
  - name: q12096.spq
    data: |
      SELECT ALL 20 + + col0 * 22 * - - 61 * + col1 * + 83 * + 29 AS col2 FROM tab2 (FORMAT parquet) cor0 WHERE col2 + + - col2 * 52 * + + col1 NOT BETWEEN NULL AND - col0;
  - name: tab2

outputs:
  - name: q12096.out
    data: |
